import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AdminNavigation from './AdminNavigation'; // Import the navigation component
import CustomerTable from './CustomerTable'; // Import Customer Table
import OrderTable from './OrderTable'; // Import Order Table
import ProductTable from './ProductTable'; // Import Product Table

const Admin = () => {
  return (
        <Routes>
          <Route path="/admin/customers" element={<CustomerTable />} />
          <Route path="/admin/orders" element={<OrderTable />} />
          <Route path="/admin/products" element={<ProductTable />} />
        </Routes>
  );
};

export default Admin;
